import Grid from '@mui/material/Grid';
import ScrollAnimation from 'react-animate-on-scroll';
import 'animate.css';

export default function WatchComponent(props) {
    return (
        <div className="watch-component" ref={props.myref}>
            <ScrollAnimation initiallyVisible={true} animateIn='fadeIn' duration={4}>
            <Grid
                container
                direction="row"
                justifyContent="center"
                alignItems="center"
                rowSpacing={10}
            >
                {/* <Grid md={0} xs={0} /> */}
                <Grid
                    item
                    md={6}
                    xs={6}
                >
                    {/* <ScrollAnimation initiallyVisible={true} animateIn='fadeIn' duration={4}> */}
                        <div class="media-stretch animate__animated animate__fadeIn animate__slower">
                            <iframe src="https://www.youtube.com/embed/BDF0VDIjcEY?autoplay=0&mute=1" frameborder="0" allow="autoplay; encrypted-media" title='demo-video'></iframe>
                        </div>
                    {/* </ScrollAnimation> */}
                </Grid>
                <Grid
                    item
                    container
                    direction="column"
                    justifyContent="center"
                    alignItems="center"
                    md={6}
                    xs={7}
                >
                    {/* <ScrollAnimation initiallyVisible={false} animateIn='fadeIn' duration={5}> */}
                        <Grid item>
                            <div className='watch-header animate__animated animate__fadeIn animate__slower'>
                                Promotional Video
                            </div>
                        </Grid>
                        <Grid container>
                            <Grid item md={3} xs={0}></Grid>
                            <Grid item md={6}>
                                <div className='watch-par animate__animated animate__fadeIn animate__slower'>
                                    Discover Fashion Fusion in our video!
                                    See how our cutting-edge tool scores outfit compatibility,
                                    helping you create perfectly styled looks every time.
                                </div>
                            </Grid>
                            <Grid item md={3} xs={0}></Grid>
                        </Grid>
                    {/* </ScrollAnimation> */}
                </Grid>
                {/* <Grid md={1} xs={0}/> */}
            </Grid>
            </ScrollAnimation> 
        </div>
    );
}
